import React from "react";
import { Route, Navigate } from "react-router-dom";

const ProtectedRoute = ({ auth, component: Component, ...rest }) => {

        if (auth) return <Component {...props} />;
        if (!auth)
          return Navigate("/");



};

export default ProtectedRoute;
